  [],\n\t\"revision_timestamp\": \"2015-09-26T23:43:46.328389\",\n\t\"name\": \"noaa-office-for-coastal-management-coastal-inundation-digital-elevation-model-gray-portland-wea\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These data were created as part of the
  National Oceanic and Atmospheric Administration Office for Coastal Management's
  efforts to create an online mapping viewer called the Sea Level Rise and Coastal
  Flooding Impacts Viewer. It depicts potential sea level rise and its associated
  impacts on the nation's coastal areas. The purpose of the mapping viewer is to provide
  coastal managers and scientists with a preliminary look at sea level rise (slr)
  and coastal flooding impacts. The viewer is a screening-level tool that uses nationally
  consistent data sets and analyses. Data and maps provided can be used at several
  scales to help gauge trends and prioritize actions for different scenarios. The
  Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed at: http://www.coast.noaa.gov/slr
  This metadata record describes the Gray/Portland Weather Forecast Office (GYX WFO)
  digital elevation model (DEM), which is a part of a series of DEMs produced for
  the National Oceanic and Atmospheric Administration Office for Coastal Management's
  Sea Level Rise and Coastal Flooding Impacts Viewer described above. The DEMs created
  for this project were developed using the NOAA National Weather Service's Weather
  Forecast Office (WFO) boundaries. This DEM includes the best available lidar known
  to exist at the time of DEM creation that met project specifications for the Gray/Portland
  WFO, which includes the coastal areas of the counties of Waldo, Knox, Kennebec,
  Lincoln, Sagadahoc, Androscoggin, Cumberland, and York in Maine and Strafford and
  Rockingham in New Hampshire. The DEM was produced from LiDAR datasets acquired by
  the U.S. Geological Survey (USGS) under the LiDAR for the Northeast Project. Hydrographic
  breaklines were delineated from LiDAR intensity imagery generated from the LiDAR
  dataset. The final DEM is hydro flattened such that water elevations are less than
  or equal to -0.5 meters. The DEM is referenced vertically to the North American
  Vertical Datum of 1988 (NAVD88) with vertical units of meters and horizontally to
  the North American Datum of 1983 (NAD83). The resolution of the DEM is approximately
  10 meters.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
